from typing import List

from ib_users.interactors.storages.user_accounts_storage import \
    UserAccountsStorage


class CheckIsUserIdsExistsInteractor:

    def __init__(self, storage: UserAccountsStorage):
        self.storage = storage

    def check_is_user_ids_already_exists_wrapper(self, user_ids: List[str]):
        self.check_is_user_ids_already_exists(user_ids=user_ids)

    def check_is_user_ids_already_exists(self, user_ids: List[str]):
        self.storage.check_is_user_ids_already_exists(user_ids=user_ids)
